    "contracts/adapters/RangeEthAdapterInitializable.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/proxy/utils/Initializable.sol";
import "../interfaces/IAdapter.sol";
import "../interfaces/IRangeEthVault.sol";

contract RangeEthAdapterInitializable is IAdapter, Initializable, Ownable, ReentrancyGuard {
    using SafeERC20 for IERC20;

    string public constant PROTOCOL = "Range";
    uint8 public constant VERSION = 1;
    uint256 public constant PRECISION = 1e18;

    address public wrapper;
    address public vault;
    address public token0;
    address public token1;
    address public lpToken;

    event SetWrapper(address indexed oldWrapper, address indexed newWrapper);
    event SetVault(address indexed oldVault, address indexed newVault, address token0, address token1, address lpToken);
    event ApproveToken(IERC20 indexed _token, address indexed _spender, uint256 _amount);
    event TransferToken(IERC20 indexed _token, address indexed _recipient, uint256 _amount);

    modifier onlyWrapper() {
        require(wrapper == msg.sender, "onlyWrapper: caller is not the wrapper");
        _;
    }

    /// * INIT *
    constructor() {}

    function initialize(
        address _wrapper,
        address _vault,
        address _admin
    ) external initializer {
        require(_wrapper != address(0) && _vault != address(0) && _admin != address(0), "initialize: address cant be zero");
        wrapper = _wrapper;
        vault = _vault;
        token0 = IRangeEthVault(vault).token0();
        token1 = IRangeEthVault(vault).token1();
        lpToken = vault;
        transferOwnership(_admin);
    }

    receive() external payable {}
    fallback() external {}

    /// * GETTER *
    function totalSupply(
    ) public view returns(uint256) {
        return IRangeEthVault(vault).totalSupply();
    }

    function tokenPerShare(
    ) public view returns(uint256 _token0PerShare, uint256 _token1PerShare) {
        (_token0PerShare, _token1PerShare) = IRangeEthVault(vault).getUnderlyingBalancesByShare(PRECISION);
    }

    function pool(
    ) public view returns(address) {
        return IRangeEthVault(vault).pool();
    }

    function manager(
    ) public view returns(address) {
        return IRangeEthVault(vault).manager();
    }

    function managerFee(
    ) public view returns(uint256) {
        return IRangeEthVault(vault).managingFee() * PRECISION / 10_000;
    }

    /// * OWNER *
    function setWrapper(
        address _newWrapper
    ) external onlyOwner {
        require(_newWrapper != address(0), "setWrapper: address cant be zero");

        address oldWrapper = wrapper;

        wrapper = _newWrapper;

        emit SetWrapper(oldWrapper, wrapper);
    }

    function setVault(
        address _newVault
    ) external onlyOwner {
        require(_newVault != address(0), "setVault: address cant be zero");

        address oldVault = vault;

        vault = _newVault;

        token0 = IRangeEthVault(vault).token0();
        token1 = IRangeEthVault(vault).token1();
        lpToken = vault;

        emit SetVault(oldVault, vault, token0, token1, lpToken);
    }

    function approveToken(
        IERC20 _token, 
        address _spender, 
        uint256 _amount
    ) external onlyOwner {
        _token.approve(_spender, _amount);

        emit ApproveToken(_token, _spender, _amount);
    }

    function transferToken(
        IERC20 _token, 
        address _recipient, 
        uint256 _amount
    ) external onlyOwner {
        uint256 balance = _token.balanceOf(address(this));
        if (balance < _amount) {
            _amount = balance;
        }

        _token.safeTransfer(_recipient, _amount);

        emit TransferToken(_token, _recipient, _amount);
    }

    /// * VAULT *
    function deposit(
        uint256 _amount0,
        uint256 _amount1,
        address _user,
        bytes calldata
    ) external nonReentrant onlyWrapper returns(uint256 mintAmount) {
        (uint256 amount0Current, uint256 amount1Current) = IRangeEthVault(vault).getUnderlyingBalances();
        uint256 totalSupply_ = totalSupply();
        require(amount0Current > 0 || amount1Current > 0, "deposit: no current balance");
        if (amount0Current == 0 && amount1Current > 0) {
            mintAmount = _amount1 * totalSupply_ / amount1Current;
        } else if (amount1Current == 0 && amount0Current > 0) {
            mintAmount = _amount0 * totalSupply_ / amount0Current;
        } else {
            uint256 amount0Mint = _amount0 * totalSupply_ / amount0Current; 
            uint256 amount1Mint = _amount1 * totalSupply_ / amount1Current;
            mintAmount = amount0Mint <= amount1Mint ? amount0Mint : amount1Mint;
        }

        IERC20(token0).safeTransferFrom(wrapper, address(this), _amount0);
        IERC20(token1).safeTransferFrom(wrapper, address(this), _amount1);
        IERC20(token0).forceApprove(vault, _amount0);
        IERC20(token1).forceApprove(vault, _amount1);

        uint256[2] memory amounts;
        amounts[0] = _amount0;
        amounts[1] = _amount1;

        (uint256 amount0Used, uint256 amount1Used) = IRangeEthVault(vault).mint(mintAmount, false, amounts);

        require(_amount0 >= amount0Used && _amount1 >= amount1Used, "deposit: incorrect token amount");

        IERC20(lpToken).safeTransfer(wrapper, mintAmount);

        if (IERC20(token0).balanceOf(address(this)) > 0) IERC20(token0).safeTransfer(_user, IERC20(token0).balanceOf(address(this)));
        if (IERC20(token1).balanceOf(address(this)) > 0) IERC20(token1).safeTransfer(_user, IERC20(token1).balanceOf(address(this)));
    }

    function withdraw(
        uint256 _share,
        address _user,
        bytes calldata
    ) external nonReentrant onlyWrapper returns(uint256 _amount0, uint256 _amount1) {
        IERC20(lpToken).safeTransferFrom(wrapper, address(this), _share);
        IERC20(lpToken).forceApprove(vault, _share);

        uint256[2] memory amounts;

        (_amount0, _amount1) = IRangeEthVault(vault).burn(_share, false, amounts);

        IERC20(token0).safeTransfer(_user, _amount0);
        IERC20(token1).safeTransfer(_user, _amount1);

        if (IERC20(lpToken).balanceOf(address(this)) > 0) IERC20(lpToken).safeTransfer(_user, IERC20(lpToken).balanceOf(address(this)));
    }
}"
